import React, { Component } from 'react'
import { Button } from 'reactstrap'

export default function NewBSBtnFunc() {

    let btnArray = ["Red", "Blue", "Yellow"]

    foreach(btnArray)
    return React.createElement(
        Button,
        {variant: 'primary'},
        'New Button',
      )   
}
